import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCloud } from '@fortawesome/free-solid-svg-icons';


const Menu = () => {
    return(
        <div id="menu">
            <div class="toggle"></div>
            <li style={{"--i" : 0}}>
                <div><FontAwesomeIcon icon={faCloud}/></div>
            </li>
            <li style={{"--i" : 1}}>
                <div></div>
            </li>
            <li style={{"--i" : 2}}>
                <div></div>
            </li>
            <li style={{"--i" : 3}}>
                <div></div>
            </li>
            <li style={{"--i" : 4}}>
                <div></div>
            </li>
        </div>
    )
};

export default Menu;
